class iatAPI{constructor(){this.endPoints={POST_results:function(e){$.ajax({type:"POST",url:"api/iat/results",contentType:"application/json",dataType:"json",data:JSON.stringify(e),async:!1,error:function(){window.location.href="/errorCustom?msg=An unexpected error occurred when posting the test results! Please contact server admin."}})},POST_survey:function(e,t){$.ajax({type:"POST",url:"api/survey",contentType:"application/json",dataType:"json",data:JSON.stringify(e),success:t,error:function(){window.location.href="/errorCustom?msg=An unexpected error occurred when posting the survey results! Please contact server admin."}})},GET_stimuli:function(e,t){$.ajax({type:"GET",url:`api/iat/stimuli?stage=${e}`,dataType:"json",success:t,error:function(){window.location.href="/errorCustom?msg=An unexpected error occurred when getting the test stimuli! Please contact server admin."}})}}}}